import "./App.css";
import SideMenu from "./components/SideMenu";
import Home from "./components/HomeComponent";

function App() {
  return (
    <div className="App d-flex">
      <SideMenu />
      <div className="vertical-divider"></div>
      <Home />
      <div className="vertical-divider"></div>
    </div>
  );
}

export default App;
